import React from "react";
import Emoji from "./Emoji";
import emojipedia from "../emojipedia";

function emojiInfo(info){
  return (
    <Emoji 
        emoji = {info.emoji}
        name = {info.name}
        maining = {info.maining}
      />
  );
}

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>

      {emojipedia.map(emojiInfo)}


    </div>
  );
}

export default App;
